fim:
  log: 
    dir: /logs
    level: debug
    conf-path: E:\project\my\X-fim-parent\conf\logback.xml
  codec:
    max-packet-size: 65535
    heartbeat: -33
    version: 1
    header-length: 11
    check-sum-key: 
  crypto:
    enable: true
    aes:
      key-length: 16
    rsa: 
      private-key: 
      public-key: 
  server: 
    enable-epoll: true
    session:
      expire-time: 3600
    tcp:
      enable: true
      ip: 127.0.0.1
      port: 8001
    ws:
      enable: true
      ip: 127.0.0.1
      port: 8002
    http:
      enable: true
    udp:
      enable: true
      ip: 127.0.0.1
      port: 8003
nacos:
  server-list: 127.0.0.1:8848
    
  
      
      
